did.abstract:
De Directie voor Administratieve Zaken heeft van 1949 tot 1976 bestaan en heeft in de loop der tijd wel enige organisatorische veranderingen gekend, maar de taken van de directie zijn niet veel veranderd. In 1976 is de Directie voor Administratieve Zaken uiteengevallen in meerdere kleinere directies en afdelingen. De Directie Interne Zaken is in 1985 mede ontstaan vanuit verschillende andere directies. Onder de Directie Interne Zaken vallen verschillende afdelingen die elk hun eigen takenpakket hebben. De directie is in de loop der jaren vaak veranderd. Veel afdelingen zijn er bijgekomen en velen zijn ook weer verdwenen. De archiefbescheiden die we tijdens de bewerking zijn tegengekomen hadden betrekking op:
- De organisatie en reorganisatie;
- Personeelsaangelegenheden van het ministerie en de daaronder ressorterende rijksdiensten en instellingen;
- De huishouding van het ministerie en de centrale post- en archiefbehandeling;
- De huisvesting;
- Jaarwerkplannen, jaarverslagen en beleidsplannen;
- Adviseren van de departementsleiding op het gebied van intern management in het bijzonder met betrekking tot de facilitaire diensten ten behoeve van het ministerie (waaronder de documentaire functie);
- Adviseren omtrent het (inter)departementaal beleid op het gebied van de documentaire informatievoorziening;
- Het behandelen van aanvragen voor koninklijke onderscheidingen.

bioghist.p:
Als taakvoorganger had de Directie Interne Zaken de Directie Administratieve Zaken. De Directie voor Administratieve Zaken heeft van 1949 tot 1976 bestaan en heeft in de loop der tijd wel enige organisatorische veranderingen gekend, maar de taken van de directie zijn niet veel veranderd. De Directie voor Administratieve Zaken was belast met:  


De uitvoering van de Comptabiliteitswet 1927;


Het voeren van de centrale boekhouding van het ministerie en van administraties voor bijzondere doeleinden;


De controle op het financieel beheer van onder het ministerie ressorterende rijksdiensten en instellingen;


De samenstelling van begrotingen, rekening en verslagen wegens de uitgaven;


De betaalbaarstelling van vorderingen, traktementen, reis en verblijfkosten en vacatiegelden;


Personeelsaangelegenheden van het ministerie en de daaronder ressorterende rijksdiensten en instellingen;


De huishouding van het ministerie en de centrale post- en archiefbehandeling;


Materieelbeheer en voorziening, dienstvervoer, huisvesting en bedrijfszelfbescherming.

In 1976 is de Directie voor Administratieve Zaken uiteengevallen in meerdere kleinere directies en afdelingen. De Directie Interne Zaken is in 1985 mede ontstaan vanuit verschillende andere directies. Onder de Directie Interne Zaken vallen verschillende afdelingen die elk hun eigen takenpakket hebben. De directie is in de loop der jaren vaak veranderd. Veel afdelingen zijn er bijgekomen en velen zijn ook weer verdwenen. Het takenpakket van de Directie Interne Zaken is divers zoals af te lezen valt aan de volgende taakomschrijving:  


Het leveren van bijdragen in de (inter) departementale beleidsontwikkelingen terzake;


Het adviseren van de departementsleiding op het gebied van intern management in het bijzonder met betrekking tot de facilitaire diensten ten behoeve van het ministerie (waaronder de documentaire functie);


Het adviseren omtrent het (inter-)departementaal beleid op het gebied van de documentaire informatievoorziening;


Het behandelen van aanvragen voor koninklijke onderscheidingen;


Het regelen van officiële ontvangsten en coördineren van protocollaire aangelegenheden en de beantwoording van aan H.M. de Koningin en leden van het Koninklijk Huis gerichte verzoeken;


Toezicht houden op nucleaire installaties in Nederland voor wat betreft de naleving van de beveiligingsvoorschriften;


Het dragen van de verantwoordelijkheid voor de concrete uitvoering van de facilitaire diensten;


Het voeren van het financieel beheer van de interne facilitaire diensten;


Het verzorgen van het betalingsverkeer betreffende materiële uitgaven van het ministerie met betrekking tot huisvesting en interne milieuzorg;


Verzorgen van telexverkeer;


Vormen en uitvoeren van het departementale beleid op het gebied van de documentaire informatievoorziening;


Het (doen) zorg dragen voor optimale voorzieningen c.q. beheer, op terreinen van beveiliging en bedrijfszelfbescherming; documentaire informatievoorziening; drukwerk; tele- en datacommunicatie; dienstvervoer en dienstreizen; huisvesting; apparatuur; onderhoud en overige materiële aangelegenheden.

